        public static string ParseLogoUrl(string logoUrl)
        {
            return logoUrl.HasValue() && logoUrl.StartsWith("http") ? logoUrl : "https://icon.foundation/prep/logo256.png";
        }

        public static string ToBase64ImgSrc(this string instance)
        {
            return instance == null ? instance : $"data:image/png;base64,{Images[instance.ToCharArray().Sum(x => x) % (Images.Count - 1)]}";
        }

